 german_union_block_desc:0 "Союз Германских Нация — современная Священная Римская империя германской нации, которая перестала существовать во время Наполеоновских войн. После Мартовской революции в 1848 Пруссия стала главой Германских наций, отчего мировая ситуация возымела иной вид. Австрия старается взять власть в свои руки, став новым лидером германского региона, однако в Австрии присутствуют внутренние проблемы и на данный момент она не достигла данной цели.\n\n[german_union_leader] [german_union_leader1][german_union_leader2][german_union_leader3]\n\nСтраны члены: [german_union_member1][german_union_member2][german_union_member3][german_union_member4][german_union_member5][german_union_member6][german_union_member7][german_union_member8][german_union_member9][german_union_member10][german_union_member11][german_union_member12][german_union_member13][german_union_member14][german_union_member15][german_union_member16][german_union_member17][german_union_member18][german_union_member19][german_union_member20][german_union_member21][german_union_member22][german_union_member23][german_union_member24][german_union_member25][german_union_member26][german_union_member27][german_union_member28][german_union_member29][german_union_member30]\n\nCторонники [?PRU.GetNameWithFlag]: [german_union_for_pru1][german_union_for_pru2][german_union_for_pru3][german_union_for_pru4][german_union_for_pru5][german_union_for_pru6][german_union_for_pru7][german_union_for_pru8][german_union_for_pru9][german_union_for_pru10][german_union_for_pru11][german_union_for_pru12][german_union_for_pru13][german_union_for_pru14][german_union_for_pru15][german_union_for_pru16][german_union_for_pru17][german_union_for_pru18][german_union_for_pru19][german_union_for_pru20][german_union_for_pru21][german_union_for_pru22][german_union_for_pru23][german_union_for_pru24][german_union_for_pru25][german_union_for_pru26][german_union_for_pru27][german_union_for_pru28][german_union_for_pru29][german_union_for